import React from 'react';
import { Container } from 'react-bootstrap';

const UserTypeScreen = ({ history }) => {
	return (
		<Container>
			<div className="row">
				<div
					className="col-sm-6"
					style={{ backgroundColor: 'rgb(255, 246, 247)' }}
				>
					<h1 style={{ textAlign: 'center' }}>Basic</h1>
					<p>
						<ul style={{ listStyleType: 'none' }}>
							<li style={{ textAlign: 'center' }}>
								<i className="fas fa-check"> Add to Cart</i>{' '}
							</li>
							<li>
								{' '}
								<i className="fas fa-check"> Buy Products Online</i>{' '}
							</li>
							<li>
								{' '}
								<i className="fas fa-check">Rate Products</i>{' '}
							</li>
							<li>
								{' '}
								<i className="fas fa-check"> Review Products</i>{' '}
							</li>
						</ul>
					</p>
				</div>
				<div
					className="col-sm-6"
					style={{ backgroundColor: 'rgb(255, 226, 253)' }}
				>
					<h1 style={{ textAlign: 'center' }}> Premium </h1>
					<p>
						<ul style={{ listStyleType: 'none' }}>
							<li>
								<li> Add to Cart</li>
								<li> Buy Products Online </li>
								<li> Rate Products </li>
								<li> Review Products </li>
								<li> View Product Look Book </li>
							</li>
						</ul>
					</p>
				</div>
			</div>
			<a href="/register">
				{' '}
				<i className="fas fa-angle-double-right"></i> Register Now!
			</a>
		</Container>
	);
};

export default UserTypeScreen;
